import "./SearchList.css";
import dataSearch from "../../data/search.json";
const SearchList = () => {
  return (
    <div className="card-searchlist">
      <img src={dataSearch[0].image_url}></img>
      <div className="detail-searchlist">
        <h2 className="name-hotel">name</h2>
        <p>distance</p>
        <p className="tag">tag</p>
        <p className="description">description</p>
        <p>type</p>
        <p className="free_cancel">freecancellation</p>
        <p className="free_cancel-detail">
          you can cancel later, so lock in this great price today!
        </p>
      </div>
      <div className="rate-searchlist">
        <div className="rate">
          <p>rate text</p>
          <p>rate</p>
        </div>
        <p>price</p>
        <p>Includes taxes and fees</p>
        <button>See availability</button>
      </div>
    </div>
  );
};
export default SearchList;
